ng The Right Major and Career* by Tes Bakat Indonesia\n.\nWorkshop:\n(11.00 \u2013 13.00 WIB) UTS Startups Workshop - Entrepreneurship in Digital Era\n(13.30 \u2013 15.00 WIB) Psychology and Theory of Mind* by Dr. Marieke de Vries\n(15.15 \u2013 16.45 WIB) Dramatic Storytelling in Film\n\nUntuk Workshop kelas terbatas hanya 30 orang peserta\nkamu dapat melakukan registrasi untuk seminar dan workshop secara online di link:\n\nSeminar\/Workshop Tangerang : bit.ly\/seminar-tgr-2020\nSeminar\/Workshop Jakarta : bit.ly\/seminar-jkt-2020\n\nPastikan kamu tidak melewatkan expo ini!!!\n.\n\ud83d\ude4f Diskusikan rencana studi kamu dengan para pakar di bidangnya, hanya di International Education Expo!\n\u200d.\n\ud83d\udc69\u200d\ud83d\udc67\u200d\ud83d\udc67 Ajak Teman\/Orang tua\/Saudara kamu sekarang juga! Acara ini Gratis & Terbuka untuk umum!\n.\nKalo bisa, kami sarankan kamu dapat melakukan Registrasi Online Expo untuk menghindari antrian:\n.\n* 18 Januari (Tangerang) bit.ly\/expo-sun-tgr2020\n* 19 Januari (Jakarta) bit.ly\/expo-sun-jkt2020\natau kamu dapat melalui link di bio IG @sunedugroup\n.\nAtau kamu bisa langsung datang datang dan Registrasi di tempat!\n.\n\ud83e\udd47\ud83e\udd47 See u at Expo Tangerang & Jakarta"}}]},"edge_media_preview_comment":{"count":14,"page_info":{"has_next_page":true,"end_cursor":"QVFDZVVMT053SnFKOWRHUkxOS1lDaXFQajhVRVRlQldHNVVHOENaZzd3QmtUVUk5dWlfMkNEN3JQUGJpX083REdOeDZzelRuTnZxNzh1WkU3bVNkX3hiTA=="},"edges":[{"node":{"id":"18123001759014321","text":"@anastasiamarianaa iya kk dh tau yg ini, tmnin kk donk ca kesini nya","created_at":1578631333,"did_report_as_spam":false,"owner":{"id":"431799186","profile_pic_url":"https:\/\/instagram.fcgk13-1.fna.fbcdn.net\/v\/t51.2885-19\/s150x150\/79371407_773304869812191_5581937556003487744_n.jpg?_nc_ht=instagram.fcgk13-1.fna.fbcdn.net&_nc_ohc=6zeAqUxUoDgAX_OmlEB&oh=ef506dff2ec47795d21ca7a7d8305313&oe=5E9E5B79","username":"diraacr"},"viewer_has_liked":false}},{"node":{"id":"17889694195449606","text": n Mengalahkan Kejahatan\" \ud83d\ude0d *Event Indoindians Holi Color Run*\n\nYuk catat tanggalnya :\n\ud83d\udccd Plaza Parkir Timur Senayan GBK\n\ud83d\udcc6 Minggu 01 Maret 2020\n.\n.\n___\nHarga tiket : [ PRESALE 2 ]  Ex. 31 Januari 2020 \n___\n1. Paket HOLI : 75 k\n- \u2705holi powder 4 warna\ud83c\udf08\n\n2.Paket SILVER : 150k\n- \u2705Tshirt\n- \u2705Medali\ud83c\udfc5\n- \u2705Holi Powder 1 Warna\n\n3. Paket GOLD : 300k\n- \u2705Tshirt\n- \u2705Medali\ud83c\udfc5\n- \u2705Holi Powder 4 warna\ud83c\udf08\n- \u2705Goodie bag\n- \u2705Kacamata\n\n4. Paket Group : 950k\n- \u2705paket sama seperti GOLD \ud83c\udfc5( lebih hemat 50ribu \/ orang)\n\n5. Festival Pack : 70 K\n- \u2705 T- shirt\n- \u2705 Holi powder 1 warna \ud83c\udf08\n\n6. Paket Bag : 65 K\n- \u2705 T- shirt\n- \u2705 Goodie Bag .\n*noted* : All package include medali\ud83c\udf96\ud83c\udf96\ud83c\udf96 (Except paket Holy dan Festival Pack tidak mendapatkan medali\u274c\ud83c\udf96)\n.\n.\nBagi kamu yang mau dapetin tiket gratis dari HOLIRUN silahkan pantengin Instagram @idcr.official setiap harinya, \ud83d\ude0d akan ada GIVEAWAY menarik lainnya bagi kamu yang ingin ikutan #holirun \ud83e\udd73\ud83e\udd73\ud83e\udd73\n.\n.\n.\nLet's join us\n.\nSilahkan menghubungi Contact Person dibawah ini :\n\ud83d\udcde  CP :  0882 1890 8291 atau 0812 7512 0354 WA\n\n@idcr.official\n@indoindians\n\n#festivalholijakarta\n#cintamengalahkankejahatan\n#holiruncolorjakarta\n#idcr2020\n#colorrun. Id\n#indonesiacolorrun\n#holi\n#run\n#jakarta\n#indonesia"}}]},"edge_media_preview_comment":{"count":288,"page_info":{"has_next_page":true,"end_cursor":"QVFCSC1GazYwcm1rVHZRY094YlRhT0l1T2VnUjc0bV9kSk1zSWRMV04ySkFVSERBeG1lcE1MRG1TNURoWGFfaVFWMjhzNXAtTXBxMElCWjJHWFBtX1l6bg=="},"edges":[{"node":{"id":"17850991171785482","text":"@sarahmarissaa @ghinaadsv @katonkusuma udh sold out","created_at":1578632378,"did_report_as_spam":false,"owner":{"id":"2287063749","profile_pic_url":"https:\/\/instagram.fcgk13-1.fna.fbcdn.net\/v\/t51.
